//import { withAmp } from 'next/amp';

const Rotaconversordeunidade = function(props){
  var regiao = Util.validaProps(props.url.query.regiao,"RJ")
  return(
    <Templateconversordeunidade
      modo="html"
      regiao={regiao}/>
